import React from 'react';


const WizardField =(props) =>{

    return(
        <div>
            <label>
                label:
            </label>
                    <input 
                        type="text"
                        value={props.name} 
                        onChange={(e)=>props.name=e.target.value}
                    />
        </div>
    );
}

export default WizardField;
